import React, { useState } from "react";
import Basura from "../componets/Basura";
import PdfIcon from "../componets/PdfIcon";
import QrIcon from "../componets/QrIcon";
import EditIcon from "../componets/EditIcon"
import Modal from "../componets/Modal";
import AddRegistro from "../componets/AddRegistro";
export function Registro(props) {
  const [AcitveModal,setAcitveModal] = useState(false);
  const data = [
    ["Covid 19", "Examen Isopado "],
    ["Antiquenos", "sadad lkjadslkj"],
    ["Covid 19", "Examen Isopado "],
    ["Antiquenos", "sadad lkjadslkj"],
  ];
  return (
    <div className="container  min-h-screen">
      {AcitveModal&&<Modal cerrar={()=>setAcitveModal(false) } titulo={'Agregar Paciente'}><AddRegistro/></Modal>}
      <button onClick={()=>setAcitveModal(true)} className="m-4 bg-green-primary py-2 px-4 rounded-lg text-white text-lg">

        + Agregar Registro
      </button>

      <table className="bg-white w-11/12 mx-auto mt-6 rounded-t-lg">
        <thead className="bg-blue-primary text-white rounded-t-lg">
          <tr className="text-xl rounded-t-lg">
            <th className="rounded-tl-lg">Nº Cedula</th>
            <th className="">Paciente</th>
            <th className="">Examen</th>
            <th className="">Fecha</th>
            <th className="w-10"></th>
            <th className="w-10"></th>
            <th className="w-10"></th>
            <th className="rounded-tr-lg w-10 "></th>
          </tr>
        </thead>
        <tbody className="text-center">
          {data.map((element, i) => {
            let border = 'border-gray-300'
            let color ='bg-white'
            if (i % 2 === 0) {color = 'bg-gray-400'; border='border-white'} 
            return (
              <tr className="bg-gray-200 ">
                <td className={`py-2 ${color} ${border} `}>{element[0]}</td>
                <td className={`py-2 border-l ${color} ${border} `}>{element[1]}</td>
                <td className={`py-2 border-l ${color} ${border} `}></td>
                <td className={`py-2 border-l ${color} ${border} `}></td>
                <td className={`py-2 border-l ${color} ${border} `}>{<PdfIcon/>}</td>
                <td className={`py-2 border-l ${color} ${border} `}>{<QrIcon/>}</td>
                <td className={`py-2 border-l ${color} ${border} `}>{<EditIcon/>}</td>
                <td className="py-2 bg-red-500">{<Basura/>}</td>
              </tr>
            );
          })}
        </tbody>
      </table>
    </div>
  );
}
